import React, { Component } from 'react'
import './Login.css';
import { tsConstructorType } from '@babel/types';
import { Link,Redirect } from 'react-router-dom';
class Login extends Component {


    constructor(props) {
        super(props)
        let loggedIn =false
        this.state = {
            username:'',
            password:'',
            loggedIn

        }
        this.onChange=this.onChange.bind(this)
        this.submitForm=this.submitForm.bind(this)
    }

    onChange(e){
        this.setState({
            [e.target.name]: e.target.value
        })
    }
    submitForm(e){
        e.preventDefault()
        const {username , password} =this.state
        if(username=== "a" && password==="b"){
            this.setState({
                loggedIn: true
            })
        }

    }


    render() {

        if(this.state.loggedIn){
            return <Redirect to="/AboutUs"/>

        }

        return (
                <div className="login-form"> 

                <form onSubmit={this.submitForm}>
                <strong>LOGIN</strong>
                <label className ="form-content" >
                    <input  className="login-details" type="text" name="username"  placeholder="Username" value={this.state.username} onChange={this.onChange}/>
                </label>
                <br></br>
                <label className ="login-details" >
                    <input className="login-details" type="password" name="password" placeholder="Password" value={this.state.password} onChange={this.onChange}/>
                </label>
                <br></br>
                <div className="login-button-container">


                <button className="submit-button" type="submit" >Submit</button>
                <button className="submit-button" type="submit" >Signup</button>
                </div>
                </form>


            </div>
        )
    }
}

export default Login
